Ext.define('Admin.view.transactionSections.idimages.IdImagesTab', {
    extend:'Ext.panel.Panel',
    xtype: 'idImagesTab', 
    title: 'Id Images',  
    height:330,
    items: [ 
//        {
//            xtype: 'image',
//            cls: 'userProfilePic',
////            height: 120,
////            width: 120,
//            alt: 'profile-picture',
//            //src: "data:image/jpeg;base64,"
////            src: "data:image/jpeg;base64," + btoa(atob(""))
//        } 
    ],
    load: function(entityId, recordData){
        var me = this;
        
        me.removeAll();
        
        Request.load({
            url:'/page/transaction/idImage/' + entityId, 
            success: function(response){
               
               if(response && response.data && response.data.idFrontImage){
                 //  idFront.src = response.data.idFrontImage;
                 me.add({xtype: 'image', src: response.data.idFrontImage});
               }
               
               if(response && response.data && response.data.idBackImage){
                 //  idFront.src = response.data.idFrontImage;
                 me.add({xtype: 'image', src: response.data.idBackImage});
               }
            }})
    }
});
